import React, { useState, useEffect } from 'react';
import { Text, View,Button } from 'react-native';



const Press = (props) =>{
    const [onPress] = useState(true);
    if (!onPress) {
        return null;
    }
    return alert('Knap klikket')
}

const StateButton =  () =>{
    return(
        <View>
            <Button Press={onPress}>
                <Text>Dette er en knap</Text>
            </Button>
        </View>

    )
}


export default StateButton;
